SELECT SUPPLIER.S_NATIONKEY, PARTSUPP.PS_SUPPLYCOST, REGION.R_COMMENT, NATION.N_NATIONKEY, COUNT(PARTSUPP.PS_SUPPKEY), MAX(SUPPLIER.S_PHONE) FROM PARTSUPP JOIN SUPPLIER ON SUPPLIER.S_SUPPKEY=PARTSUPP.PS_SUPPKEY JOIN NATION ON NATION.N_NATIONKEY=SUPPLIER.S_NATIONKEY JOIN REGION ON REGION.R_REGIONKEY=NATION.N_REGIONKEY GROUP BY SUPPLIER.S_NATIONKEY, PARTSUPP.PS_SUPPLYCOST, REGION.R_COMMENT, NATION.N_NATIONKEY HAVING MAX(SUPPLIER.S_PHONE) >= '11-383-516-1199' AND COUNT(PARTSUPP.PS_SUPPKEY) > 1;
